import React from 'react';
import {Grid, Cell} from 'react-mdl';
import {Link } from 'react-router-dom';
const Experience = () => {

    return (
       <div>
          <Grid>
            <Cell col={4}>
            <div style={{textAlign: 'center'}}>
              <img
                src="https://image.flaticon.com/icons/png/512/15/15077.png"
                alt="avatar"
                style={{height: '200px'}}
                 />
             </div>
             <h2 style={{textAlign: 'center', margin: 'auto', paddingTop: '1em'}} font = 'Latos'>Matthew Barron</h2>
             <hr/>
             <p>{"      "}</p>
             <p>{"      "}</p>
              <h4 style={{ textAlign: 'center', width: '75%', margin: 'auto', paddingTop: '1em', textDecorationLine: 'underline'}} >Contact me:</h4>
              <p style={{ textAlign: 'center', width: '75%', margin: 'auto', paddingTop: '1em', fontSize: '17px'}}>Email: matthew.barron@macaulay.cuny.edu</p>
              <p style={{ textAlign: 'center', width: '75%', margin: 'auto', paddingTop: '1em', fontSize: '17px'}}>Phone: 914-619-4166</p>
              <p style={{ textAlign: 'center', width: '75%', margin: 'auto', paddingTop: '1em', fontSize: '17px'}}><Link to="https://github.com/matt-barron"><i class="fa fa-github-square" aria-hidden="true"/></Link></p>
              <p style={{ textAlign: 'center', width: '75%', margin: 'auto', paddingTop: '1em', fontSize: '17px'}}><Link to="https://www.linkedin.com/in/matthew-barron-b55369185/"><i class="fa fa-linkedin" aria-hidden="true"/></Link></p>
           </Cell>
           <Cell className = "experience-right-col" col={8}>
             Right Side
           </Cell>
          </Grid>
       </div>
    );
}

export default Experience;
